import React, { useEffect, useRef, useCallback, useState } from 'react';
import * as d3 from 'd3';
import { Cpu, Wrench, Zap, Activity } from 'lucide-react';
import { renderToString } from 'react-dom/server';

const GraphComponent = ({ data }) => {
  const svgRef = useRef(null);
  const containerRef = useRef(null);
  const simulationRef = useRef(null);
  const nodesRef = useRef([]);
  const linksRef = useRef([]);
  const linkSelectionRef = useRef(null);
  const nodeSelectionRef = useRef(null);
  const [dimensions, setDimensions] = useState({ width: 0, height: 0 });

  // Get icon SVG string based on node type
  const getIconSvg = (type, status) => {
    const color = status === 'running' ? '#00ffff' : '#f59e0b';
    let IconComponent;

    switch (type) {
      case 'main':
        IconComponent = Cpu;
        break;
      case 'sub-agent':
        IconComponent = Activity;
        break;
      case 'tool':
        IconComponent = Wrench;
        break;
      default:
        IconComponent = Zap;
    }

    const svgString = renderToString(<IconComponent size={20} color={color} />);
    return `data:image/svg+xml;base64,${btoa(svgString)}`;
  };

  // Handle window resize
  useEffect(() => {
    const updateDimensions = () => {
      if (containerRef.current) {
        const { width, height } = containerRef.current.getBoundingClientRect();
        setDimensions({ width, height });
      }
    };

    updateDimensions();
    window.addEventListener('resize', updateDimensions);
    return () => window.removeEventListener('resize', updateDimensions);
  }, []);

  // Initialize or update simulation
  const updateGraph = useCallback(() => {
    if (!svgRef.current || dimensions.width === 0 || dimensions.height === 0) return;

    const svg = d3.select(svgRef.current);
    const width = dimensions.width;
    const height = dimensions.height;

    // Set SVG dimensions explicitly
    svg.attr('width', width).attr('height', height);

    // Initialize data structures if empty or different
    const currentNodeIds = new Set(nodesRef.current.map(n => n.id));
    const newNodeIds = new Set(data.nodes.map(n => n.id));

    // Add new nodes at center
    data.nodes.forEach(newNode => {
      if (!currentNodeIds.has(newNode.id)) {
        nodesRef.current.push({ 
          ...newNode, 
          x: width / 2 + (Math.random() - 0.5) * 100, 
          y: height / 2 + (Math.random() - 0.5) * 100 
        });
      } else {
        // Update status on existing nodes
        const existing = nodesRef.current.find(n => n.id === newNode.id);
        if (existing) {
          existing.status = newNode.status;
          existing.name = newNode.name;
        }
      }
    });

    // Remove nodes no longer present
    nodesRef.current = nodesRef.current.filter(n => newNodeIds.has(n.id));

    // Update links - convert string IDs to node references
    linksRef.current = data.links.map(l => ({
      source: typeof l.source === 'string' ? l.source : l.source.id,
      target: typeof l.target === 'string' ? l.target : l.target.id,
      active: l.active
    }));

    // Create or update simulation
    if (!simulationRef.current) {
      simulationRef.current = d3.forceSimulation(nodesRef.current)
        .force('link', d3.forceLink(linksRef.current).id(d => d.id).distance(120))
        .force('charge', d3.forceManyBody().strength(-400))
        .force('center', d3.forceCenter(width / 2, height / 2))
        .force('collision', d3.forceCollide().radius(d => {
          if (d.type === 'main') return 50;
          if (d.type === 'sub-agent') return 40;
          return 30;
        }));
    } else {
      simulationRef.current.nodes(nodesRef.current);
      simulationRef.current.force('link').links(linksRef.current);
      simulationRef.current.force('center', d3.forceCenter(width / 2, height / 2));
      simulationRef.current.alpha(0.5).restart();
    }

    // Clear and re-render everything for simplicity
    svg.selectAll('*').remove();

    // Create groups
    const linkGroup = svg.append('g').attr('class', 'links');
    const particleGroup = svg.append('g').attr('class', 'particles');
    const nodeGroup = svg.append('g').attr('class', 'nodes');

    // Render links
    linkSelectionRef.current = linkGroup
      .selectAll('line')
      .data(linksRef.current)
      .enter()
      .append('line')
      .attr('stroke', d => d.active ? '#00ffff' : '#333')
      .attr('stroke-width', d => d.active ? 2 : 1)
      .attr('stroke-opacity', d => d.active ? 0.8 : 0.3)
      .attr('class', d => d.active ? 'link-active' : '');

    // Render nodes
    nodeSelectionRef.current = nodeGroup
      .selectAll('g')
      .data(nodesRef.current, d => d.id)
      .enter()
      .append('g')
      .attr('class', d => `node ${d.status === 'running' ? 'pulsing' : ''}`)
      .call(d3.drag()
        .on('start', dragstarted)
        .on('drag', dragged)
        .on('end', dragended));

    // Add glow ring for running nodes
    nodeSelectionRef.current
      .append('circle')
      .attr('class', d => `glow-ring ${d.status === 'running' ? 'pulse-animation' : ''}`)
      .attr('r', d => d.type === 'main' ? 45 : d.type === 'sub-agent' ? 35 : 25)
      .attr('fill', 'none')
      .attr('stroke', d => d.status === 'running' ? '#00ffff' : 'transparent')
      .attr('stroke-width', 2)
      .attr('opacity', d => d.status === 'running' ? 0.6 : 0);

    // Add main circle
    nodeSelectionRef.current
      .append('circle')
      .attr('r', d => d.type === 'main' ? 35 : d.type === 'sub-agent' ? 28 : 20)
      .attr('fill', '#1a1a1a')
      .attr('stroke', d => d.status === 'running' ? '#00ffff' : '#f59e0b')
      .attr('stroke-width', 2);

    // Add icon
    nodeSelectionRef.current
      .append('image')
      .attr('xlink:href', d => getIconSvg(d.type, d.status))
      .attr('x', d => d.type === 'main' ? -10 : d.type === 'sub-agent' ? -8 : -6)
      .attr('y', d => d.type === 'main' ? -10 : d.type === 'sub-agent' ? -8 : -6)
      .attr('width', d => d.type === 'main' ? 20 : d.type === 'sub-agent' ? 16 : 12)
      .attr('height', d => d.type === 'main' ? 20 : d.type === 'sub-agent' ? 16 : 12);

    // Add label
    nodeSelectionRef.current
      .append('text')
      .text(d => d.name)
      .attr('dy', d => d.type === 'main' ? 55 : d.type === 'sub-agent' ? 45 : 35)
      .attr('text-anchor', 'middle')
      .attr('fill', '#888')
      .attr('font-size', '11px')
      .attr('font-family', 'monospace')
      .attr('font-weight', '500');

    // Simulation tick
    simulationRef.current.on('tick', () => {
      // Keep nodes within bounds
      nodesRef.current.forEach(d => {
        const padding = 60;
        d.x = Math.max(padding, Math.min(width - padding, d.x));
        d.y = Math.max(padding, Math.min(height - padding, d.y));
      });

      linkGroup.selectAll('line')
        .attr('x1', d => d.source.x)
        .attr('y1', d => d.source.y)
        .attr('x2', d => d.target.x)
        .attr('y2', d => d.target.y);

      nodeGroup.selectAll('g')
        .attr('transform', d => `translate(${d.x},${d.y})`);
    });

    // Create particles on active links
    const activeLinks = linksRef.current.filter(l => l.active);
    activeLinks.forEach((link, i) => {
      createParticle(particleGroup, link, i * 300);
    });

    function createParticle(container, link, delay) {
      const particle = container
        .append('circle')
        .attr('r', 4)
        .attr('fill', '#00ffff')
        .attr('filter', 'drop-shadow(0 0 4px #00ffff)')
        .attr('opacity', 0);

      animateParticle(particle, link, delay);
    }

    function animateParticle(particle, link, delay) {
      if (!link.source.x || !link.target.x) return;

      particle
        .attr('cx', link.source.x)
        .attr('cy', link.source.y)
        .transition()
        .delay(delay)
        .duration(1200)
        .ease(d3.easeLinear)
        .attr('opacity', 1)
        .attrTween('transform', function() {
          return function(t) {
            const x = link.source.x + (link.target.x - link.source.x) * t;
            const y = link.source.y + (link.target.y - link.source.y) * t;
            return `translate(${x - link.source.x},${y - link.source.y})`;
          };
        })
        .on('end', function() {
          d3.select(this).attr('opacity', 0);
          animateParticle(particle, link, 0);
        });
    }

    // Drag functions
    function dragstarted(event, d) {
      if (!event.active) simulationRef.current.alphaTarget(0.3).restart();
      d.fx = d.x;
      d.fy = d.y;
    }

    function dragged(event, d) {
      d.fx = event.x;
      d.fy = event.y;
    }

    function dragended(event, d) {
      if (!event.active) simulationRef.current.alphaTarget(0);
      d.fx = null;
      d.fy = null;
    }
  }, [data, dimensions]);

  // Initialize and update
  useEffect(() => {
    updateGraph();
  }, [updateGraph]);

  // Cleanup on unmount
  useEffect(() => {
    return () => {
      if (simulationRef.current) {
        simulationRef.current.stop();
      }
    };
  }, []);

  return (
    <div ref={containerRef} style={{ width: '100%', height: '100%' }}>
      <svg
        ref={svgRef}
        style={{ 
          width: '100%', 
          height: '100%', 
          background: 'transparent',
          display: 'block'
        }}
      />
    </div>
  );
};

export default GraphComponent;
